import logo from './logo.svg';
import './App.css';
import LoginButton from './components/LoginButton'
import Profile from './components/profile';
import LogautButton from './components/LogoutButton';


function App() {
  return (
    <div className="App">
      <h1>Aplicación</h1>
      <LoginButton/> 
      <LogautButton/>
      <Profile/>

    </div>
  );
}

export default App;
